import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faMapMarkerAlt, faClock } from '@fortawesome/free-solid-svg-icons';
import { faTwitter, faGoogle, faResearchgate, faGithub } from '@fortawesome/free-brands-svg-icons';

const Contact = () => {
  return (
    <div>
      <h2>Contact</h2>

      <div className="contact-info">
        <h3><FontAwesomeIcon icon={faEnvelope} /> Email</h3>
        <p>zi.wang.prince@hotmail.com</p>

        <h3><FontAwesomeIcon icon={faMapMarkerAlt} /> Address</h3>
        <p>Beijing, China</p>
        <p>Post Number: 100000</p>

        <h3><FontAwesomeIcon icon={faEnvelope} /> Meida</h3>
        <p>
          <a href="https://github.com/nanawanzii" target="_blank" rel="noreferrer">
            <FontAwesomeIcon icon={faGithub} /> Github
          </a>
        </p>

        <h3><FontAwesomeIcon icon={faClock} /> 办公时间</h3>
        <p>周一至周五: 上午10:00 - 下午4:00</p>
        <p>请提前通过邮件预约</p>
      </div>
    </div>
  );
};

export default Contact;
